(()=>{if(slider_object.settings.settings.hasAutoplay){var e=slider_object.settings.settings.autoplay.duration;new Swiper(slider_object.slider_id,{spaceBetween:30,centeredSlides:!0,loop:!0,autoplay:{delay:e},navigation:{nextEl:slider_object.slider_id+" .swiper-button-next",prevEl:slider_object.slider_id+" .swiper-button-prev"}})}else new Swiper(slider_object.slider_id,{spaceBetween:30,centeredSlides:!0,loop:!0,navigation:{nextEl:slider_object.slider_id+" .swiper-button-next",prevEl:slider_object.slider_id+" .swiper-button-prev"}})})();